// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract GasPriceManager {
    uint256 public gasPrice;

    address public agent; // The AI agent address authorized to update the gas price
    address public admin;   // The admin that manages the contract

    modifier onlyAgentOrAdmin() {
        require(msg.sender == agent || msg.sender == admin, "Not authorized");
        _;
    }

    // Set the agent and admin at deployment
    constructor(address _agent, address _admin) {
        agent = _agent;
        admin = _admin;
    }

    // Allow the agent or admin to update the gas price
    function updateGasPrice(uint256 _newGasPrice) external onlyAgentOrAdmin {
        gasPrice = _newGasPrice;
    }
}

